import React, { useEffect } from "react";
import Grid from "@material-ui/core/Grid";
import ObraSocialForm from "./ObraSocialForm";
import { makeStyles } from "@material-ui/core/styles";
import { getListaObrasSocial } from "actions/ObraSocialActions";
import ObraSocialTable from "./ObraSocialTable";
import { useDispatch } from "react-redux";
export default function ObraSocial() {
  const classes = useStyles();
  const dispatch = useDispatch();
  useEffect(() => {}, []);

  return (
    <Grid container>
      <Grid item xs={12} sm={6} md={6} lg={6} className={classes.listaOS}>
        <ObraSocialTable />
      </Grid>
      <Grid item xs={12} sm={6} md={6} lg={6} className={classes.borderForm}>
        <ObraSocialForm />
      </Grid>
    </Grid>
  );
}
const useStyles = makeStyles((theme) => ({
  borderForm: {
    height: "100%",
  },
  listaOS: {
    height: "100%",
    borderRight: "1px solid #e4e4e4",
  },
}));
